import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Box,
  Tabs,
  Tab,
  CircularProgress,
} from '@mui/material';
import {
  Bookmark as BookmarkIcon,
  BookmarkBorder as BookmarkBorderIcon,
} from '@mui/icons-material';
import axios from '../utils/axios';
import { useAuth } from '../contexts/AuthContext';

const ResourceCard = ({ resource, onBookmark, isBookmarked }) => {
  const navigate = useNavigate();

  return (
    <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
      <CardContent sx={{ flexGrow: 1 }}>
        <Typography gutterBottom variant="h6" component="h2">
          {resource.title}
        </Typography>
        <Typography color="text.secondary" gutterBottom>
          {resource.category}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {resource.description}
        </Typography>
      </CardContent>
      <CardActions>
        <Button
          size="small"
          color="primary"
          onClick={() => window.open(resource.url, '_blank')}
        >
          Visit Resource
        </Button>
        <Button
          size="small"
          color="primary"
          onClick={() => onBookmark(resource)}
          startIcon={isBookmarked ? <BookmarkIcon /> : <BookmarkBorderIcon />}
        >
          {isBookmarked ? 'Bookmarked' : 'Bookmark'}
        </Button>
      </CardActions>
    </Card>
  );
};

const Home = () => {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [trending, setTrending] = useState({
    local: [],
    github: [],
    arxiv: [],
  });
  const [loading, setLoading] = useState(true);
  const [tabValue, setTabValue] = useState(0);
  const [bookmarks, setBookmarks] = useState(new Set());

  useEffect(() => {
    fetchTrending();
    if (user) {
      fetchBookmarks();
    }
  }, [user]);

  const fetchTrending = async () => {
    try {
      const response = await axios.get('/api/search/trending');
      setTrending(response.data);
    } catch (error) {
      console.error('Error fetching trending resources:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchBookmarks = async () => {
    try {
      const response = await axios.get('/api/bookmarks');
      const bookmarkIds = new Set(response.data.bookmarks.map(b => b.resource.id));
      setBookmarks(bookmarkIds);
    } catch (error) {
      console.error('Error fetching bookmarks:', error);
    }
  };

  const handleBookmark = async (resource) => {
    if (!user) {
      navigate('/login');
      return;
    }

    try {
      if (bookmarks.has(resource.id)) {
        await axios.delete(`/api/bookmarks/${resource.id}`);
        setBookmarks(prev => {
          const newBookmarks = new Set(prev);
          newBookmarks.delete(resource.id);
          return newBookmarks;
        });
      } else {
        await axios.post(`/api/bookmarks/${resource.id}`);
        setBookmarks(prev => new Set([...prev, resource.id]));
      }
    } catch (error) {
      console.error('Error toggling bookmark:', error);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Trending AI Resources
      </Typography>

      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
        <Tabs value={tabValue} onChange={handleTabChange}>
          <Tab label="Local Resources" />
          <Tab label="GitHub Repositories" />
          <Tab label="arXiv Papers" />
        </Tabs>
      </Box>

      <Grid container spacing={4}>
        {tabValue === 0 &&
          trending.local.map((resource) => (
            <Grid item key={resource.id} xs={12} sm={6} md={4}>
              <ResourceCard
                resource={resource}
                onBookmark={handleBookmark}
                isBookmarked={bookmarks.has(resource.id)}
              />
            </Grid>
          ))}

        {tabValue === 1 &&
          trending.github.map((repo) => (
            <Grid item key={repo.id} xs={12} sm={6} md={4}>
              <ResourceCard
                resource={{
                  id: repo.id,
                  title: repo.name,
                  description: repo.description,
                  url: repo.url,
                  category: 'GitHub Repository',
                }}
                onBookmark={handleBookmark}
                isBookmarked={bookmarks.has(repo.id)}
              />
            </Grid>
          ))}

        {tabValue === 2 &&
          trending.arxiv.map((paper) => (
            <Grid item key={paper.id} xs={12} sm={6} md={4}>
              <ResourceCard
                resource={{
                  id: paper.id,
                  title: paper.title,
                  description: paper.summary,
                  url: paper.url,
                  category: 'arXiv Paper',
                }}
                onBookmark={handleBookmark}
                isBookmarked={bookmarks.has(paper.id)}
              />
            </Grid>
          ))}
      </Grid>
    </Container>
  );
};

export default Home;
